        da: DimensionGasSettings,
        l1: DimensionGasSettings,
        l2: DimensionGasSettings,
        inclusion_fee: Field
    ) -> Self {
        Self { da, l1, l2, inclusion_fee }
    }

    fn get_gas_limits(self) -> Gas {
